        $this->addSql('INSERT INTO notification_template (template_id, subject, body, type) VALUES (1, \'Drafts of recurring invoices have been created\', \'UCRM just created drafts for recurring invoices. You can approve them and send as PDF to your clients.\', 1)');
        $this->addSql('INSERT INTO notification_template (template_id, subject, body, type) VALUES (2, \'Invitation\', \'Dear %CLIENT_FIRST_NAME%! Your UCRM account has just been created. You can log in here: %CLIENT_FIRST_LOGIN_URL%\', 2)');
        $this->addSql('INSERT INTO notification_template (template_id, subject, body, type) VALUES (3, \'New invoice\', \'Dear %CLIENT_FIRST_NAME%! We are sending you new invoice for internet services.\', 3)');
        $this->addSql('INSERT INTO notification_template (template_id, subject, body, type) VALUES (4, \'Invoice is overdue\', \'Dear %CLIENT_FIRST_NAME%! Please help us to identify your payment for invoice %INVOICE_NUMBER%\', 4)');
        $this->addSql('INSERT INTO notification_template (template_id, subject, body, type) VALUES (5, \'Service is suspended\', \'Dear %CLIENT_FIRST_NAME%! As we did not receive any payment for this service, it will be temporarily suspended\', 5)');
        $this->addSql('INSERT INTO notification_template (template_id, subject, body, type) VALUES (6, \'Forgotten password\', \'Dear %CLIENT_FIRST_NAME%! To reset your password, please continue by clicking here: %CLIENT_RESET_PASSWORD_URL%\', 6)');
        $this->addSql('INSERT INTO notification_template (template_id, subject, body, type) VALUES (7, \'Postpone suspend\', \'Dear %CLIENT_FIRST_NAME%! Your service suspension has been postponed\', 7)');
        $this->addSql('INSERT INTO notification_template (template_id, subject, body, type) VALUES (8, \'SUSPEND_ANONYMOUS\', \'<p>Your internet service has been temporarily suspended as we did not receive any payment and your invoice is overdue.<br />Please follow the instructions in your email to pay for the invoice.</p>\', 8)');
        $this->addSql('INSERT INTO notification_template (template_id, subject, body, type) VALUES (9, \'SUSPEND_RECOGNIZED\', \'<p>Dear %CLIENT_FIRST_NAME% %CLIENT_LAST_NAME%,<br />your internet service %SERVICE_TARIFF% has been temporarily suspended as we did not receive any payment and your invoice is overdue.<br />Please follow the instructions in your email to pay for the invoice.</p>\', 9)');

