        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (1, 4, \'MAPBOX_TOKEN\', \'MapBox.com Token\', \'This token is used to generate maps for displaying client services, sites etc. Please generate your own token at mapbox.com\', \'string\', \'\', \'1\', NULL, NULL)');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (2, 0, \'SITE_NAME\', \'Site name\', \'Organization site name used for this app.\', \'string\', \'A site name\', \'1\', NULL, NULL)');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (3, 0, \'STOP_SERVICE_DUE\', \'Suspend overdue services\', \'If checked, client\'\'s service will be suspended when related invoice is overdue.\', \'bool\', \'1\', \'4\', NULL, NULL)');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (4, 1, \'STOP_SERVICE_DUE_DAYS\', \'Suspend hold up limit\', \'Number of days for which the suspend is deferred. For example, if 3 days are set and invoice due date is 17th March the suspend will start from 20th March\', \'int\', \'1\', \'4\', NULL, NULL)');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (5, 0, \'INVOICING_PERIOD_TYPE\', \'Billing period type\', \'Forward = recurring invoices are created at the beginning of billing period (clients pay for the service in advance); Backward = recurring invoices are created at the end of billing period\', \'choice\', \'1\', \'2\', NULL, \'{"choices":{"1":"Backwards","2":"Forwards"}}\')');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (6, 2, \'SEND_INVOICE_BY_EMAIL\', \'Send invoice by email\', \'If checked, the approved invoices are sent by email (helpful for batch recurring invoicing) Still, you can change this manually invoice by invoice.\', \'bool\', \'1\', \'2\', NULL, NULL)');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (7, 3, \'STOP_INVOICING\', \'Stop invoicing for stopped services\', \'If checked, invoicing will be terminated once a service has ended (proration will be used for the last billed period). Otherwise the invoicing will continue even for stopped services.\', \'bool\', \'1\', \'2\', NULL, NULL)');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (8, 1, \'DISCOUNT_INVOICE_LABEL\', \'Discount invoice label\', \'Default discount label. Can be overridden in every invoice.\', \'string\', NULL, \'2\', NULL, NULL)');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (9, 3, \'MAILER_TRANSPORT\', \'Transport type\', NULL, \'choice\', \'smtp\', \'3\', NULL, \'{"choices":{"smtp":"smtp","gmail":"gmail","mail":"mail","sendmail":"sendmail"},"choice_translation_domain":false}\')');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (10, 0, \'MAILER_HOST\', \'Host\', \'Server host used for mailing\', \'string\', NULL, \'3\', NULL, NULL)');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (11, 4, \'MAILER_SENDER_ADDRESS\', \'Sender address\', \'This will be used only for system notifications sent the administrator email (e.g. when drafts for recurring invoices are created)\', \'string\', \'\', \'3\', NULL, NULL)');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (12, 1, \'MAILER_USERNAME\', \'Username\', NULL, \'string\', NULL, \'3\', NULL, NULL)');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (13, 2, \'MAILER_PASSWORD\', \'Password\', NULL, \'string\', NULL, \'3\', NULL, NULL)');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (14, 3, \'INVOICE_TIME_HOUR\', \'Hour for generating recurring invoices\', \'At this hour recurring invoices will be generated. You can also set the day of month for this action in organization settings.\', \'int\', \'10\', \'1\', NULL, NULL)');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (15, 5, \'LATE_FEE_TAXABLE\', \'Late fee taxable\', \'If checked, taxes related to client will be applied.\', \'bool\', \'0\', \'4\', NULL, NULL)');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (16, 3, \'LATE_FEE_INVOICE_LABEL\', \'Late fee invoice label\', NULL, \'string\', \'Late fee\', \'4\', NULL, NULL)');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (17, 4, \'LATE_FEE_PRICE\', \'Late fee price\', NULL, \'int\', \'0\', \'4\', NULL, NULL)');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (18, 2, \'LATE_FEE_ACTIVE\', \'Late fee active\', \'If checked, late fee will be created when a invoice is overdue. This fee will be applied to the next invoice automatically unless you void it.\', \'toggle\', \'0\', \'4\', NULL, NULL)');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (19, 1, \'SERVER_IP\', \'Server IP\', \'IP of the server where this application is deployed. (Used for redirects to walled garden)\', \'string\', NULL, \'1\', NULL, NULL)');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (20, 2, \'SUPPORT_EMAIL_ADDRESS\', \'Support email address\', \'Where the client\'\'s messages will be sent to from the client-zone contact form\', \'string\', \'\', \'1\', NULL, NULL)');
        $this->addSql('INSERT INTO option (option_id, position, code, name, description, type, value, category_id, value_txt, choice_type_options) VALUES (21, 0, \'SUSPEND_ENABLED\', \'Suspend feature\', \'Suspend feature automatically stops internet services of clients with overdue invoices. You can disable this feature here. Note that all suspended services will be activated by doing so.\', \'toggle\', \'0\', \'4\', NULL, NULL)');

